import React from 'react';

const Home = () => {
  return (
    <div>
      <h1 className="cover-heading">Welcome to Beers & Brewskies!</h1>
      <p className="lead">Take a look around</p>
      <p className="lead">
        <a href="#" className="btn btn-lg btn-secondary">Learn more</a>
      </p>
    </div>
  )
}

export default Home;
